import Learncodebed from '../template/Learncodebed.png'
import Blenderbed from '../template/Blenderpaper.png'

function Archivement() {
    return (
        <div>
<img src={Blender} alt="gambar tidak tersedia" className="codepaper"/>
<img src={Learncodebed} alt="gambar tidak tersedia" className="codepaper"/>
        </div>
    )
}
export default Archivement;
